css:
@-moz-document domain("reactnavigation.org") {
.main-app {
    background-color: #2A2A2C;
}
.pt-navbar {
    background-color: #2A2A2C;
}
.footer {
    background-color: #2A2A2C;
}
.pt-menu {
    background-color: #333335;
}
.navmenu a.pt-menu-item.page {
    color: #767685;
}
.navmenu li.pt-menu-header,
.navmenu li.pt-menu-header>h6 {
    color: #767685;
}
body {
    color: #C0C0C0;
}
h1 {
    color: #767685;
}
.md-header {
    color: #C0C0C0;
}
.navmenu a.active,
.navmenu li.pt-menu-header.active,
.navmenu li.pt-menu-header.active h6 {
    color: #C0C0C0;
}
.navmenu a.pt-menu-item.page.active {
    color: #C0C0C0;
}
.md-section code,
.md-section pre {
    background: #333335;
    color: #C0C0C0;
}
.token.function {
    color: #E5C078;
}
.token.keyword {
    color: #A36AD8;
}
.token.string {
    color: #98C379;
}
.token.tag {
    color: #E06968;
}
.token.number {
    color: #D1975C;
}
}
